import React from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import styles from "./index.module.scss";



interface Props { }
export default (props: Props) => {
    return (
        <Container fluid >
            <Row>
                {/* product Image slider and thumbnails */}
                <Col sm >
                    <Row className={styles.ImageSliderContainer + " "}>
                        <Col sm={3} className={styles.thumbnailsCol + " -bg-f0f-"} >
                            <div className="-bg-ff0- d-flex -jus-c--sm-dn- ">
                                <div className={"-bg-0ff- d-flex flex-md-column " + styles.thumbnailContainer}>
                                    {["", "", "", "", ""].map(() => {
                                        return (
                                            <div className="my-md-2 -mx-10-" style={{ minHeight: 50, width: 50, backgroundColor: "blue" }}></div>
                                        )
                                    })}
                                    <div className={styles.thumbnail + " " + styles.thumbnailUp + " " + styles.thumbnailRight}></div>
                                    <div className={styles.thumbnail + " " + styles.thumbnailDown + " " + styles.thumbnailLeft}></div>
                                </div>
                            </div>
                        </Col>
                        <Col sm={9}>image slider</Col>
                    </Row>
                </Col>
                {/* Product infod accordion */}
                <Col sm style={{ backgroundColor: "green" }}>
                    Image Slider
                </Col>
            </Row>
        </Container>
    )
}
